 Jesus said in John 14:6 “I am the way, the truth, and the life. No one comes to the father except through me.” This is the message that needs to be shared to heal this next generation and reverse the course of moral pragmatism that has become prevalent in our culture.\r\n\r\n## The Scope\r\n\r\nWe plan to organize outreach events initially across the United States and eventually, Lord willing, follow the calling of the “Great Commission” in Matthew 28 to share the Gospel with as many nations as possible around the globe. Our initial scope begins within the United States because we see not only a great need for evangelism and revival in this country, but also a great opportunity. The infrastructure necessary to host large scale events coupled with the modern technology and networking we enjoy in this country allow us to have the potential to reach an extremely large audience across a large geographic area.\r\n\r\nWe intend for these events to be held free of charge. A partnership with local churches in each city will be vital to effectively producing these events. We will rely upon them to help promote the event to their community, aid in raising funds to make the events possible, provide counselors at the event, and follow-up with new believers.\r\n\r\nThe founders of EOTA Ministries have over 10 years of professional touring experience with the band Kutless and have been a part of numerous large festivals, crusades, fairs, conferences, tours, and events. We believe this experience will enable us to produce successful, professional, and effective events that can have an impact on the lives of thousands.',NULL,'<img data-responsimage=\"jonmicah_singing-517b06e16e8cf.jpg\" style=\"position:absolute;left:0;width:100%;height:400px;\" data-responsimage-anchor=\"5\" src=\"/workspace/img/spacer.gif\" />\r\n<div class=\"spacer\" style=\"height:400px;\"> </div>\r\n\r\n# Why Does EOTA Exist?\r\n\r\n<span class=\"intro\">It is imperative that we spread the gospel to this generation and find ways to help them create a firm biblical foundation.</span>\r\n\r\n## The Statistics\r\n\r\nStatistics are showing a clear decline of Evangelical Christianity in the United States while we are simultaneously seeing the secularization of the church:\r\n\r\n- 53% of U.S. leaders said the state of Evangelicalism is worse than it was five years ago, and 48 percent said they expect it to grow worse in the next five years.\r\n- “The un-churched population in the United States is so extensive that, were it a nation, it would be the fifth-largest on the planet... Researchers and analysts describe North America as the world’s third-largest mission field.” [CITATION NEEDED]\r\n- Only 33% of mainline churchgoers agree that there are absolute standards for what is right and wrong\r\n- Only 36% of Evangelical Church goers believe that their religion is the one, true faith leading to eternal life while 57% believed many religions can lead to everlasting life.\r\n- 65% of 18-30 year olds who have previously attended church regularly leave the church\r\n\r\n## The Need\r\n\r\nIt is apparent that the need for true evangelism along with Biblical values and worldview are increasingly needed in our country. We believe right NOW is a critical time. The consequences of not reaching the next generation with the absolute truth of the gospel will be dire.  Jesus said in John 14:6 “I am the way, the truth, and the life. No one comes to the father except through me.” This is the message that needs to be shared to heal this next generation and reverse the course of moral pragmatism that has become prevalent in our culture.\r\n\r\n## The Scope\r\n\r\nWe plan to organize outreach events initially across the United States and eventually, Lord willing, follow the calling of the “Great Commission” in Matthew 28 to share the Gospel with as many nations as possible around the globe. Our initial scope begins within the United States because we see not only a great need for evangelism and revival in this country, but also a great opportunity. The infrastructure necessary to host large scale events coupled with the modern technology and networking we enjoy in this country allow us to have the potential to reach an extremely large audience across a large geographic area.\r\n\r\nWe intend for these events to be held free of charge. A partnership with local churches in each city will be vital to effectively producing these events. We will rely upon them to help promote the event to their community, aid in raising funds to make the events possible, provide counselors at the event, and follow-up with new believers.\r\n\r\nThe founders of EOTA Ministries have over 10 years of professional touring experience with the band Kutless and have been a part of numerous large festivals, crusades, fairs, conferences, tours, and events. We believe this experience will enable us to produce successful, professional, and effective events that can have an impact on the lives of thousands.',490,'<p><img data-responsimage=\"jonmicah_singing-517b06e16e8cf.jpg\" style=\"position:absolute;left:0;width:100%;height:400px;\" data-responsimage-anchor=\"5\" src=\"/workspace/img/spacer.gif\" /></p>\n\n<div class=\"spacer\" style=\"height:400px;\"> </div>\n\n<h1>Why Does EOTA Exist?</h1>\n\n<p><span class=\"intro\">It is imperative that we spread the gospel to this generation and find ways to help them create a firm biblical foundation.</span></p>\n\n<h2>The Statistics</h2>\n\n<p>Statistics are showing a clear decline of Evangelical Christianity in the United States while we are simultaneously seeing the secularization of the church:</p>\n\n<ul>\n<li>53% of U.S. leaders said the state of Evangelicalism is worse than it was five years ago, and 48 percent said they expect it to grow worse in the next five years.</li>\n<li>“The un-churched population in the United States is so extensive that, were it a nation, it would be the fifth-largest on the planet&#8230; Researchers and analysts describe North America as the world’s third-largest mission field.” [CITATION NEEDED]</li>\n<li>Only 33% of mainline churchgoers agree that there are absolute standards for what is right and wrong</li>\n<li>Only 36% of Evangelical Church goers believe that their religion is the one, true faith leading to eternal life while 57% believed many religions can lead to everlasting life.</li>\n<li>65% of 18-30 year olds who have previously attended church regularly leave the church</li>\n</ul>\n\n<h2>The Need</h2>\n\n<p>It is apparent that the need for true evangelism along with Biblical values and worldview are increasingly needed in our country. We believe right NOW is a critical time. The consequences of not reaching the next generation with the absolute truth of the gospel will be dire.  Jesus said in John 14:6 “I am the way, the truth, and the life. No one comes to the father except through me.” This is the message that needs to be shared to heal this next generation and reverse the course of moral pragmatism that has become prevalent in our culture.</p>\n\n<h2>The Scope</h2>\n\n<p>We plan to organize outreach events initially across the United States and eventually, Lord willing, follow the calling of the “Great Commission” in Matthew 28 to share the Gospel with as many nations as possible around the globe. Our initial scope begins within the United States because we see not only a great need for evangelism and revival in this country, but also a great opportunity. The infrastructure necessary to host large scale events coupled with the modern technology and networking we enjoy in this country allow us to have the potential to reach an extremely large audience across a large geographic area.</p>\n\n<p>We intend for these events to be held free of charge. A partnership with local churches in each city will be vital to effectively producing these events. We will rely upon them to help promote the event to their community, aid in raising funds to make the events possible, provide counselors at the event, and follow-up with new believers.</p>\n\n<p>The founders of EOTA Ministries have over 10 years of professional touring experience with the band Kutless and have been a part of numerous large festivals, crusades, fairs, conferences, tours, and events. We believe this experience will enable us to produce successful, professional, and effective events that can have an impact on the lives of thousands.</p>\n'),
	(28,13935,NULL,'# Help Support Our Cause\r\n\r\n<script src=\"https://checkout.stripe.com/v2/checkout.js\"></script>\r\n\r\n<a id=\"Button50\" class=\"link link-small\">Donate $50</a>',NULL,'# Help Support Our Cause\r\n\r\n<script src=\"https://checkout.stripe.com/v2/checkout.js\"></script>\r\n\r\n<a id=\"Button50\" class=\"link link-small\">Donate $50</a>',5,'<h1>Help Support Our Cause</h1>\n\n<script src=\"https://checkout.stripe.com/v2/checkout.js\"></script>\n\n<p><a id=\"Button50\" class=\"link link-small\">Donate $50</a></p>\n');

